import React from "react";
import "./App.css";
import StopwatchDisplay from "./components/StopwatchDisplay";
import StopwatchForm from "./components/StopwatchForm/StopwatchForm";
import { StopwatchProvider } from "./contexts/StopwatchContexts";

function App() {
  return (
    <div className="App">
      <StopwatchProvider>
        <>
          <StopwatchForm />
          <StopwatchDisplay />
        </>
      </StopwatchProvider>
    </div>
  );
}

export default App;
